        int 10h
        
        mov ah,2
        mov cx,0
        mov dh,0
        mov dl,0
        int 10h                 ;move cursor
        
        mov ah,9
        lea dx,name1message
        int 21h                 ;ask user to enter name
        
        mov ah,02
        mov dh,10
        mov dl,0
        mov cx,0
        int 10h                 ;move cursor
        
        mov ah,0ah
        lea dx,player1name
        int 21h                 ;take player 1 name
        
        mov ah,2
        mov dh,20
        mov dl,0
        mov cx,0
        int 10h                 ;move cursor
        
        mov ah,9
        lea dx,enterkey
        int 21h                 ;ask the user to press enter or re-enter their name
        
        mov ah,0
        int 16h                 ;get key from user
         
        cmp ah,1ch              ;if user pressed enter continue
        jnz p1_name
        
    p2_name:
    
        mov ax,0019
        int 10h
        
        mov ah,2
        mov cx,0
        mov dh,0
        mov dl,0
