FETCH_DEST PROC NEAR

    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,',',12
    JNE SEARCH_2
    MOV AL,12
    SUB AL,CL
    SUB AL,5
    MOV DEST_SIZE,AL 
    JMP FETCH
    
    SEARCH_2:
    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,'$',12
    MOV AL,12
    SUB AL,CL
    SUB AL,6
    MOV DEST_SIZE,AL
    ;JNE EXIT_FETCH
        
    FETCH:
    MOV SI,OFFSET COMMAND_BUFFER_INSTRUCTION+4
    MOV DI,OFFSET DEST
    MOV CX,0 
    MOV CL,DEST_SIZE
    REP MOVSB
    
    EXIT_FETCH: 
    RET

FETCH_DEST ENDP

FETCH_SOURCE PROC NEAR
    
    
    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,',',12
    JNE EXIT_FETCH_SOURCE
    
    MOV DI,OFFSET COMMAND_BUFFER_INSTRUCTION
    MOV CX,19
    MOV AL,'$'
    REPNE SCASB
    INC CL
    MOV AL,19
    SUB AL,CL
    MOV DL,6
    ADD DL,DEST_SIZE
    SUB AL,DL
    MOV SOURCE_SIZE,AL
     
    MOV BL,0
    MOV BL,5
    ADD BL,DEST_SIZE
    MOV BYTE PTR GO,BL
    
    MOV SI,OFFSET COMMAND_BUFFER_INSTRUCTION
    ADD SI,GO 

    MOV DI,OFFSET SOURCE
    MOV CX,0 
    MOV CL,SOURCE_SIZE
    REP MOVSB
     
    EXIT_FETCH_SOURCE: 
    RET
    

FETCH_SOURCE ENDP


DECODE_DEST PROC NEAR

    IS_REG_ADDRESSING_MODE:

        SEARCH_ON_STRING DEST,'[',1
        JE IS_REG_INDIRECT

        ITS_2BYTE_DEST:

            MOV DEST_BYTES,2

            COMPARE_STRINGS DEST,IS_AX,2
            JE IT_AX

            COMPARE_STRINGS DEST,IS_BX,2
            JE IT_BX

            COMPARE_STRINGS DEST,IS_CX,2
            JE IT_CX

            COMPARE_STRINGS DEST,IS_DX,2
            JE IT_DX

            COMPARE_STRINGS DEST,IS_SI,2
            JE IT_SI

            COMPARE_STRINGS DEST,IS_DI,2
            JE IT_DI

            COMPARE_STRINGS DEST,IS_SP,2
            JE IT_SP

            COMPARE_STRINGS DEST,IS_BP,2
            JE IT_BP
            JMP ITS_NOT_2BYTE_DEST


            IT_AX:
                MOV DEST_CODE,0
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BX:
                MOV DEST_CODE,2
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CX:
                MOV DEST_CODE,4
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DX:  
                MOV DEST_CODE,6
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_SI:  
                MOV DEST_CODE,8
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DI:  
                MOV DEST_CODE,10
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_SP:  
                MOV DEST_CODE,12
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BP:  
                MOV DEST_CODE,14
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
        
        ITS_NOT_2BYTE_DEST:

            MOV DEST_BYTES,1

            COMPARE_STRINGS DEST,IS_AL,2
            JE IT_AL

            COMPARE_STRINGS DEST,IS_AH,2
            JE IT_AH

            COMPARE_STRINGS DEST,IS_BL,2
            JE IT_BL

            COMPARE_STRINGS DEST,IS_BH,2
            JE IT_BH

            COMPARE_STRINGS DEST,IS_CL,2
            JE IT_CL

            COMPARE_STRINGS DEST,IS_CH,2
            JE IT_CH

            COMPARE_STRINGS DEST,IS_DL,2
            JE IT_DL

            COMPARE_STRINGS DEST,IS_DH,2
            JE IT_DH
            JMP EXIT_GET_DEST

            IT_AL:
                MOV DEST_CODE,0
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_AH:
                MOV DEST_CODE,1
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST

            IT_BL:
                MOV DEST_CODE,2
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BH:
                MOV DEST_CODE,3
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CL:
                MOV DEST_CODE,4
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CH:  
                MOV DEST_CODE,5
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DL:  
                MOV DEST_CODE,6
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DH:  
                MOV DEST_CODE,7
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST 
    
    IS_REG_INDIRECT:
        
        CMP SOURCE_SIZE,4
        JNE EXIT_GET_DEST

        COMPARE_STRINGS DEST,_IS_BX_,4
        JE IT_BX_

        COMPARE_STRINGS DEST,_IS_SI_,4
        JE IT_SI_

        COMPARE_STRINGS DEST,_IS_DI_,4
        JE IT_DI_
        JMP EXIT_GET_DEST

        IT_BX_: 
            MOV DEST_CODE,2
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
        IT_SI_:  
            MOV DEST_CODE,8
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
        IT_DI_:  
            MOV DEST_CODE,10
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
    EXIT_GET_DEST:
        RET

DECODE_DEST ENDP

